import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'
const layoutStyle = {
    backgroundColor: '#BAF2D7',
    height: "100px"
};
export default function footer() {
    return (
        <Container>
            <div class="footer" style={layoutStyle}>
                <p>Footer</p>
            </div>
        </Container>
    )
}
